   /* Fill Parent */
   &RS_Employees.Fill("where company = :1 and location in ('KUNY00','KUDE00') and exists (select 'x' from ps_training t where t.emplid = fill.emplid)", &In_Company);

   rem MessageBox(0, "", 0, 0, "Pulled % EEs for Location %2", &RS_Employees.ActiveRowCount, &In_Company);

