import PSXP_RPTDEFNMANAGER:Utility;

class X_LogFile_Finder
   method X_LogFile_Finder();
   method FindArchivePath(&Initial_Path_In As string) Returns string;
   method SetInitialURL(&Initial_Path_In As string);
   method Set_Default_URL() Returns string;


   property Rowset URL_LIST get;
   property string Document_URL get;
   property Rowset File_List_Recursive get;
   property Rowset File_List_local get;

private
   method PathExists(&InTargetPath As string) Returns boolean;
   method resolveURL(&InURL As string) Returns string;
   method Find_All_Files(&directory_path As string, &BL_Recursive As boolean);
   method GetFileRSRecord() Returns Record;
   method DeSlashDirectoryPath(&InDirectoryPath As string) Returns string;
   method ConvertEpochTime(&InEpoch As number) Returns datetime;

   instance Rowset &RS_DOS_DOCREP_DEFN;
   instance Rowset &File_RS;
   instance string &Current_URL;
   instance string &Current_Path;
   instance string &Initial_URL;
   instance string &Initial_Path;
   instance string &Default_URL;
   instance string &Original_URL;

end-class;


method X_LogFile_Finder
   &File_RS = CreateRowset(Record.X_DIRECTORY);
end-method;

method SetInitialURL
   /+ &Initial_Path_In as String +/;
   Local integer &i;
   Local integer &Position;
   Local boolean &Found = False;

   &Original_URL = &Initial_Path_In;
   &Initial_Path = Substitute(LTrim(RTrim(&Initial_Path_In, " "), " "), "/", "\");
   &Current_Path = LTrim(RTrim(&Initial_Path, " "), " ");

end-method;


method Set_Default_URL
   /+ Returns String +/;

   Local integer &i;
   Local PSXP_RPTDEFNMANAGER:Utility &o_Utility = create PSXP_RPTDEFNMANAGER:Utility();


   Local string &Str_File_Name = "Test.txt";

   Local File &File_Test = GetFile(&Str_File_Name, "W", %FilePath_Relative);
   &File_Test.WriteLine("Test");
   Local string &Str_Default_File_Directory = &File_Test.Name;
   &File_Test.Close();

   &File_Test = GetFile(&Str_Default_File_Directory, "R", %FilePath_Absolute);
   &File_Test.Delete();


   &Default_URL = &o_Utility.GetDirectoryFromPath(&Str_Default_File_Directory);

   Return &Default_URL;


end-method;


get URL_LIST
   /+ Returns Rowset +/

   Return &RS_DOS_DOCREP_DEFN;
end-get;

get Document_URL
   /+ Returns String +/

   Return &Current_URL;
end-get;


method FindArchivePath
   /+ &Initial_Path_In as String +/
   /+ Returns String +/
   Local string &FoundPath;
   Local string &Current_Root, &Initial_URL_Path;
   Local integer &i;
   Local boolean &FoundURLInRepository = False;
   Local string &ResolvedURL;

   %This.SetInitialURL(&Initial_Path_In);

   /* quick find - in the defualt location - don't look further */
   If %This.PathExists(&Current_Path) Then

      &FoundPath = &Initial_Path;
      &FoundURLInRepository = True;

   End-If;

   /* if not found anywhere, return the original */
   If Not &FoundURLInRepository Then
      &FoundPath = &Original_URL;
   End-If;

   &Current_Path = &FoundPath;
   Return &FoundPath;

end-method;


method PathExists
   /+ &InTargetPath as String +/
   /+ Returns Boolean +/

   Local string &TargetPathNoFinalSlash = %This.DeSlashDirectoryPath(&InTargetPath);

   Return FileExists(&TargetPathNoFinalSlash, %FilePath_Absolute);
end-method;

method resolveURL
   /+ &InURL as String +/
   /+ Returns String +/

   /*  	R.Groncki 09/01/2017 */
   /* check if passed string is a URL object before referencing it as such - if not it will cause an error */
   /* Return back passed string if it is not a URL object */

   Local string &FoundURLObject;
   SQLExec("select 'X' from %table(PSURLDEFN) where URL_ID = :1", &InURL, &FoundURLObject);

   If All(&FoundURLObject) Then
      Return GetURL(@("URL." | &InURL));
   Else
      Return &InURL;
   End-If;

end-method;

get File_List_Recursive
   /+ Returns Rowset +/

   &File_RS.Flush();
   %This.Find_All_Files(&Current_Path, True);

   Return &File_RS;
end-get;

get File_List_local
   /+ Returns Rowset +/

   &File_RS.Flush();
   %This.Find_All_Files(&Current_Path, False);

   Return &File_RS;
end-get;

method Find_All_Files
   /+ &directory_path as String, +/
   /+ &BL_Recursive as Boolean +/

   Local array of string &FILE_NAMES, &ALL_FLDR_PATH;
   Local JavaObject &DocRepoFile;
   Local string &file_name;
   Local Field &vw_file_ext;
   Local Record &Rec_File_List_Record;

   Local string &Local_Directory_Path = %This.DeSlashDirectoryPath(&directory_path);
   Local string &Original_Directory_Path = %This.DeSlashDirectoryPath(&directory_path);

   &FILE_NAMES = FindFiles(&Local_Directory_Path | "\*", %FilePath_Absolute);
   &ALL_FLDR_PATH = CreateArrayRept("", 0);

   While &FILE_NAMES.Len > 0
      &file_name = &FILE_NAMES.Shift();

      &DocRepoFile = CreateJavaObject("java.io.File", &file_name);
      If &DocRepoFile.isDirectory() Then
         If &DocRepoFile.getName() <> "." And
               &DocRepoFile.getName() <> ".." Then
            &Local_Directory_Path = &Original_Directory_Path | "\" | &DocRepoFile.getName();

            If &BL_Recursive Then
               %This.Find_All_Files(&Local_Directory_Path, True);
            End-If;

            &Rec_File_List_Record = %This.GetFileRSRecord();
            &Rec_File_List_Record.FILE_PATH_NAME.Value = &Local_Directory_Path;
            &Rec_File_List_Record.FILE_NAME.Value = "";
            &Rec_File_List_Record.FILEREFPATHANDFILE.Value = &Local_Directory_Path;
            &Rec_File_List_Record.DIRECTORIES_LBL.Value = "Y";
            &Rec_File_List_Record.FILE_SIZE.Value = &DocRepoFile.length() / 1024;
            &Rec_File_List_Record.LASTUPDDTTM.Value = String(%This.ConvertEpochTime(Value(Substring(&DocRepoFile.lastModified(), 1, 50))));
         End-If;
      Else

         &Rec_File_List_Record = %This.GetFileRSRecord();
         &Rec_File_List_Record.FILE_PATH_NAME.Value = &Local_Directory_Path;
         &Rec_File_List_Record.FILE_NAME.Value = &DocRepoFile.getName();
         &Rec_File_List_Record.FILEREFPATHANDFILE.Value = &file_name;
         &Rec_File_List_Record.DIRECTORIES_LBL.Value = "N";
         &Rec_File_List_Record.FILE_SIZE.Value = &DocRepoFile.length() / 1024;
         &Rec_File_List_Record.LASTUPDDTTM.Value = %This.ConvertEpochTime(Value(&DocRepoFile.lastModified()));

      End-If;

      &DocRepoFile = Null;
   End-While;


end-method;

method GetFileRSRecord
   /+ Returns Record +/

   Local Record &Rec_DOS_DIREC;

   If &File_RS.ActiveRowCount > 1 Then
      &File_RS.InsertRow(0);
      &Rec_DOS_DIREC = &File_RS(1).GetRecord(Record.X_DIRECTORY);
   Else

      If All(&File_RS(1).X_DIRECTORY.FILE_PATH_NAME.Value) Then
         &File_RS.InsertRow(0);
      End-If;

      &Rec_DOS_DIREC = &File_RS(1).GetRecord(Record.X_DIRECTORY);
   End-If;



   Return &Rec_DOS_DIREC;
end-method;

method DeSlashDirectoryPath
   /+ &InDirectoryPath as String +/
   /+ Returns String +/

   Local string &FixedDirectoryPath = &InDirectoryPath;

   If Right(&FixedDirectoryPath, 1) = "\" Then
      &FixedDirectoryPath = Left(&FixedDirectoryPath, (Len(&FixedDirectoryPath) - 1));
   End-If;


   Return &FixedDirectoryPath;

end-method;

method ConvertEpochTime
   /+ &InEpoch as Number +/
   /+ Returns DateTime +/

   Local datetime &EpochStart = DateTimeValue("01/01/1970 00:00:00");
   Local integer &MiliSeconds = 1000;
   Local number &SecondsSinceEpoc = &InEpoch / &MiliSeconds;

   Return AddToDateTime(&EpochStart, 0, 0, 0, 0, 0, &SecondsSinceEpoc);

end-method;

